        function createNode(item) {
            const li = document.createElement("li");
            const span = document.createElement("span");
            span.textContent = item.title;
            span.classList.add("caret");
            li.appendChild(span);
            li.dataset.id = item.id;
            return li;
        }
        
        function buildTree(data) {
            const lookup = {};
            data.forEach(item => lookup[item.id] = { ...item, children: [] });
            const rootNodes = [];
            data.forEach(item => {
                if (item.parent_id === null) {
                    rootNodes.push(lookup[item.id]);
                } else {
                    lookup[item.parent_id]?.children.push(lookup[item.id]);
                }
            });
            return rootNodes;
        }
        
        function renderTree(nodes, parentElement) {
            nodes.forEach(node => {
                const li = createNode(node);
                if (node.children.length) {
                    const ul = document.createElement("ul");
                    ul.classList.add("nested");
                    li.appendChild(ul);
                    li.querySelector(".caret").addEventListener("click", function() {
                        ul.classList.toggle("active");
                    });
                    renderTree(node.children, ul);
                }
                parentElement.appendChild(li);
            });
        }
        
        const treeData = buildTree(data);
        renderTree(treeData, document.getElementById("tree"));
    </script>
